<html><head>
  <title>Something went wrong! | Do Something</title>
  <style type="text/css">
    body { 
      background-color: #eee; 
      color: #666; 
      text-align: center; 
      font-family: arial, sans-serif;
      width: 98%; 
      height: 100%;
    }
    div.dialog {
      max-width: 35em;
      width: 75%;
      height: 26em;
      background-color:#fff;
      position: relative;
      margin: auto;
      margin-top: 2em;
      
      border: 1px solid rgb(221, 221, 221);
      border-radius: 2px;
      -webkit-box-shadow: rgb(204, 204, 204) 0px 15px 20px -10px;
      box-shadow: rgb(204, 204, 204) 0px 15px 20px -10px;
    }
    div.info{
      background-color:#6AC8C5;
      width: 120%;
      position:absolute;
      margin: 0em 0 0 -10%;
      padding: 2em 0 1em 0;
      border: 1px solid rgb(221, 221, 221);
      
    }
    div.help{
      position:absolute;
      bottom:1em;
      margin: 0 auto;
      padding: 0 1em 0 1em;
    }
    h1 { 
      font-size: 32pt;
      line-height: 0.5em;
      color: #383735; 
    }
    h2{
      line-height: .75em;
      color: #999;
    }
    p{
      margin: auto;
      color:#999;
      font-size:8pt;
    }
    a:link, a:visited, a:active{
      color:#4E7ABC;
    }
    #small-logo {
      display: none;
    }

    @media only screen and (max-width: 590px) {
      body{
        margin:0;
      }
      div.dialog, div.info, div.help, #big-logo {
        height: auto;
      }
      div.dialog {
        padding: 0.25em 1em;
      }
      div.info {
        width: 100%;
        margin: 0 auto 1em auto;
        position: relative;
        display: block;
      }
      #big-logo {
        width: 75%;
      }
      h1 {
        font-size: 20pt;
      }
      p {
        font-size: 7pt;
      }
      div.help {
        position: relative;
        display: block;
        top: 0;
        margin-bottom:1em;
        padding:0;
      }
    }
    @media only screen and (max-width: 450px) {
      h1 {
        font-size: 14pt;
        line-height: 1em;
      }
      h2 {
        font-size: 12pt;
        line-height: 1em;
      }
      p {
        font-size: 6pt;
      }
      #big-logo {
        display: none;
      }
      #small-logo {
        display: block;
        margin: -1em auto 0 auto;
        max-width: 150px;
        width: 90%;
      }
    }
  </style>
</head>
